import React, { Component } from 'react';
import Card from './Card';

export default class CardList extends Component {
  render({robots}) {
    return (
      <>
        {robots.map((robot) => (
          <div key={robot.id}>
            <Card 
              id={robot.id}
              name={robot.name}
              username={robot.username}
              email={robot.email}
            />
          </div>
        ))}
      </>
    )
  }
}
